### **Histria**

* **Dezembro 1989**: Guido Van Rossum inicia a implementao do Python
* **Janeiro 1994**: Verso 1.0 lanado
* **Outubro 2000**: Verso 2.0 lanado
* **Dezembro 2008**: Verso 3.0 lanado
* **Junho 2009**: Verso 3.1 lanado
* **Julho 2010**: Verso 2.7 lanado
* **Outubro 2017**: Verso atual do Python  3.6
</script></section><section  data-markdown><script type="text/template">
### **Interpretada?**

O que significa para uma linguagem ser *"interpretada"*?

* *"interpretado"* e *"compilado"* se refere a implementaes, no linguagens

A implementao Python mais comum (`CPython`)  uma mistura de ambos:
* Cdigo-fonte compilado para *byte code* (arquivos `.pyc`)
* Em seguida, o *byte code*  interpretado diretamente
* Essencialmente, cdigo-fonte pode ser executado diretamente
</script></section><section  data-markdown><script type="text/template">
### **Estilo**

* Python coloca uma forte nfase na legibilidade
* Consequentemente a [PEP 8](https://www.python.org/dev/peps/pep-0008/) foi criada
* Guia de estilo para mostrar como o cdigo Python deve ficar bonito
</script></section><section  data-markdown><script type="text/template">

@app.route('/', methods=['POST'])
def handle_messages():
  message_entries = json.loads(request.data)['entry']

  for entry in message_entries:
    for message in entry['messaging']:
      sender_id = message['sender']['id']

      if message.get('message'):
        text = message['message']['text']
        reply = bot.reply(sender_id, text)
        client.send(sender_id, TextMessage(reply))
    return 'OK'
```
